import React from 'react';

interface PropData {
    outerPage: any;
    mainPage: any;
}

const Breadcrumb = (props: PropData) => {

    return (
        <div className="page-title-box d-sm-flex align-items-center justify-content-between">
            <h4 className="mb-sm-0">{props?.mainPage ?? ''}</h4>
            <div className="page-title-right">
                <ol className="breadcrumb m-0">
                    <li className="breadcrumb-item"><a href="javascript: void(0);">{props?.outerPage ?? ''}</a></li>
                    <li className="breadcrumb-item active">{props?.mainPage ?? ''}</li>
                </ol>
            </div>
        </div>
    )
}

export default Breadcrumb;
